window.bookSummaryJSON = "<p>We were watching the sky. They were already here.</p> <p><b>The pulse hits without warning.</b></p> <p>In one harrowingly destructive instant, a mysterious seismic pulse in the Scottish Highlands rips away all semblance of global security.</p> <p>Complacency grew in the years since Dan McCarthy brought humanity into contact with intelligent aliens, but those days are gone.</p> <p>When peace is shattered, fear takes over.</p> <p><b>The stakes rise without mercy.</b></p> <p>As the pulse's chaos spreads, it becomes painfully clear that Dan's teenage daughter Piper - a child born like no other - might hold humanity's only hope of averting total disaster.</p> <p>The danger to Earth is imminent. The danger to Piper McCarthy hardly bears thinking about.</p> <p>And <i>this</i> threat isn’t coming from the stars. This time, it’s been here all along....</p> <p>New discoveries, conspiracies, and threats like nothing you've ever imagined - dive into <i>Not Alone: The Awakening</i> today!</p> <p><b>Note for listeners:&nbsp;</b>Stay tuned for the next book in the series <i>Not Alone: Hidden Wonder</i>.</p>"; 
